import React from "react";

const Todo = ({ todo }) => {
	return (
		<div className='todo'>
			<li className='todo-item'>He</li>
			<button className='complete-btn'>
				<i className='fa fa-check-circle'></i>
			</button>
			<button className='trash-btn'>
				<i className='fa fa-minus-circle'></i>
			</button>
		</div>
	);
};

export default Todo;
